import React from 'react';
import TopBar from './TopBar.js'
import Widget from './Widget.js';

export default function PageLayout({children}) {
    return (
        <div style={{
            position: 'absolute',
            top: '0',
            left: '0',
            height: '100vh',
            width: '100vw',
            display: 'grid',
            gridTemplateColumns: '1fr 1fr',
            gridTemplateRows: '0.3fr 0.1fr 0.3fr 0.3fr',
            gridTemplateAreas: `'top top' 'widget widget' 'a0 a1' 'a2 a3'`,
            overflow: 'scroll',
            border: '5px solid red',
            alignItems: 'stretch'
        }}>
            <TopBar></TopBar>
            <div style={{
                display: 'flex',
                position: 'absolute',
                gridArea: 'widget'
            }}>
                <Widget>
                    A a B b C c
                </Widget>
                <Widget>
                    <input type="text" />
                </Widget>
            </div>
            <div style={{
                display: 'flex',
                flexDirection: 'column',
                border: '5px solid blue'
            }}>

                <div aria-hidden="true" style={{
                    visibility: 'hidden'
                }}>
                    <Widget>A</Widget>
                </div>
                {children}
            </div>
        </div>
    );
}
